$_MODULE['<{securitypro}prestashop>securitypro_eab7a34fb22c4aec91744341fb09c207'] = 'Nëse ndonjë nga punonjësit e tu ka nevojë për aftësinë për të kapërcyer vërtetimin me dy faktorë, ata mund të përdorin lidhjet e mëposhtme. Këto lidhje kanë një parametër shtesë në URL-në e hyrjes. Kur përdorë këtë lidhje, vërtetimi me dy faktorë anashkalohet.';
$_MODULE['<{securitypro}prestashop>securitypro_80f6bb3995b1f583fa3b43e746541ace'] = 'Informacion i rëndësishëm për webmasterin:';
