$_MODULE['<{securitypro}prestashop>securitypro_eb205fe8ecf55b2d1719509d9ea0e9f8'] = 'Vërtetimi me dy faktorë është një shtresë shtesë e sigurisë për panelin tënd të administratorit PrestaShop, i krijuar për t\'u siguruar që je personi i vetëm që mund të ketë qasje në \'back office\', edhe nëse dikush e di fjalëkalimin tënd.';
$_MODULE['<{securitypro}prestashop>securitypro_58d1de100534a730099ffe61e7cd6d36'] = 'Të lutem shkruaj dhe ruaj këtë kod rikuperimi me 12 karaktere diku të sigurt. Në rast se humb qasjen në pajisjen tënde, mund ta përdorsh këtë kod për të kaluar hapin 2FA';
$_MODULE['<{securitypro}prestashop>securitypro_899b1674eaf395a49d0e4d2dc2c31da3'] = 'Për të konfirmuar se gjithçka është e saktë, duhet të fusësh kodin tënd nga aplikacioni yt para se të ruash cilësimet.';
