$_MODULE['<{securitypro}prestashop>securitypro_798e66859ba4f472e14a4d2f8e86d754'] = 'Identifikimi i dytë';
$_MODULE['<{securitypro}prestashop>securitypro_f55c2362eeeabaff125f2b5e786f3874'] = 'Idendtifikimi i PrestaShop tashmë siguron dyqanin tënd, por ti mund të shtosh një shtresë tjetër sigurie duke shtuar një identifikim të dytë nga vetë serveri yt i uebit. Kjo bëhet duke përdorur .htpasswd (vetëm serverat Apache). Identifikimi dytë është e njëjtë për secilin punonjës, pasi kjo vendoset në nivelin e serverit.';
$_MODULE['<{securitypro}prestashop>securitypro_d5dea174437767221ff176a17f912513'] = 'Ky tipar është vetëm për përdoruesit e përparuar. Rekomandohet ta lësh këtë funksion inaktiv në shumicën e rasteve.';
$_MODULE['<{securitypro}prestashop>securitypro_23cf02cf69bc3785bfba37e69ee8ecd4'] = 'Identifikimi i dytë';
$_MODULE['<{securitypro}prestashop>securitypro_c061d6290c33e4babd8637efdedfe441'] = 'Aktivizon një identifikim të dytë nga vetë serveri të uebit.';
$_MODULE['<{securitypro}prestashop>securitypro_5019b7aa3ca2405c72ed2f35291b3f48'] = 'Do të të ndihmonte nëse do të përdorje një emër përdoruesi tjetër, atëherë bën për identifikim të rregullt në \'back office\'.';
