$_MODULE['<{securitypro}prestashop>securitypro_6d384e030115bc0683af56b09a9584ec'] = 'Fortësia e fjalëkalimit';
$_MODULE['<{securitypro}prestashop>securitypro_3dad49ac51290e87962a96b84afc277b'] = 'Matësi i fortësisë së fjalëkalimit';
$_MODULE['<{securitypro}prestashop>securitypro_6af121ce23803d49cd3fde699dbc955f'] = 'Shto një matës nën fushën e fjalëkalimit për t\'iu dhënë klientëve tu informacione të menjëhershme për forcën e fjalëkalimeve të tyre, dhe në këtë mënyrë për t\'iu dhënë kështu klientëve tu një përvojë më të sigurt të blerjes.';
$_MODULE['<{securitypro}prestashop>securitypro_da8a8fe02513eae2ff5fea9c36fd2470'] = 'HTTP Security Headers';
$_MODULE['<{securitypro}prestashop>securitypro_e68cbf02c4676dd13589b47e148bf077'] = '\'Security headers\' janë \'HTTP response headers\' që aplikacioni yt mund të përdorë për të rritur sigurinë e aplikacionit tënd. Pasi të vendosen, këto \'HTTP response headers\' mund të kufizojnë shfletuesit që të mos funksionojnë në dobësi lehtësisht të parandalueshme.';
$_MODULE['<{securitypro}prestashop>securitypro_799b812f82978bab32fcd2dc80c2c9c8'] = 'Ky modul e bën të lehtë konfigurimin e këtyre \'security headers\'.';
$_MODULE['<{securitypro}prestashop>securitypro_0ecbd09263fbb51540c782185efee55c'] = 'Mbrojtja \'click-jack\'';
$_MODULE['<{securitypro}prestashop>securitypro_b85966b487e741221ac09f8096aa1c09'] = 'Parandalon shfletuesit të kornizojnë faqen tënde. Kjo do të mbrojë nga sulmet si \'click-jacking\'.';
$_MODULE['<{securitypro}prestashop>securitypro_9fedb1818aead4c0a0768404f20d17ff'] = 'Mbrojtja \'XSS\'';
$_MODULE['<{securitypro}prestashop>securitypro_ad9730ac5b234e29a663dda9d7167d28'] = 'Vendosë konfigurimin e sigurt për filtrat \'cross-site scripting\' të integruara në shumicën e shfletuesve.';
$_MODULE['<{securitypro}prestashop>securitypro_e345e652ad332ea5e342f89dfb1f38e0'] = 'Çaktivizo nuhatjen e përmbajtjes';
$_MODULE['<{securitypro}prestashop>securitypro_c54286ba04b2afc967fc04b2dccb8c60'] = 'Ndalon shfletuesit nga përpjekja e nuhatjes të llojit të përmbajtjes MIME dhe ta detyrojë atë të qëndrojë me llojin e deklaruar të përmbajtjes.';
$_MODULE['<{securitypro}prestashop>securitypro_2332b22624e66bb09559df215e9a3e0d'] = 'Detyro lidhjen e sigurt me \'HSTS\'';
$_MODULE['<{securitypro}prestashop>securitypro_5416b7b6862b5b6440c6d1a10e03a0cd'] = 'Forcon zbatimin tënd të TLS duke kërkuar që përdoruesin agjentin e përdoriesit të zbatojë përdorimin e HTTPS.';
$_MODULE['<{securitypro}prestashop>securitypro_fe62355679694b8466b12b8da6fcdb7c'] = 'Të lutem ndiq këtë lidhje për të kuptuar këto cilësime';
$_MODULE['<{securitypro}prestashop>securitypro_fdaf9cd31e580e24f850345829ce921c'] = 'Cilësimet e \'HSTS\'';
$_MODULE['<{securitypro}prestashop>securitypro_52a86647ee43104c4cfc9e0e74428f17'] = 'Prit \'CT\'';
$_MODULE['<{securitypro}prestashop>securitypro_39237c74e89a4fcf7f275e4016937a4b'] = 'Sinjalizon agjentin e përdoruesit se duhet të zbatohet pajtueshmëria me politikën e transparencës së certifikatës.';
$_MODULE['<{securitypro}prestashop>securitypro_9a561223f129a0fdabd1ab84c221d7f7'] = 'Politika e referimit';
$_MODULE['<{securitypro}prestashop>securitypro_dc059648d1893f85dfb88fa256e43330'] = 'Shfletuesi do të dërgojë një URL të plotë së bashku me kërkesat nga një objekt i cilësimeve të mjedisit të mbrojtura nga TLS në një URL potencialisht të besueshme dhe kërkesa nga klientë të cilët nuk janë të mbrojtur nga TLS për ndonjë origjinë.';
$_MODULE['<{securitypro}prestashop>securitypro_1dfde105e346b7510196f63d2854d09d'] = 'Kontrolli i qasjes mundëson metodat';
$_MODULE['<{securitypro}prestashop>securitypro_3b81089d1a2824c7dfc4663e86e4b8d5'] = 'Serveri përgjigjet dhe thotë se vetëm POST, GET, OPTIONS janë metoda të vlefshme për të kërkuar burimin në fjalë.';
$_MODULE['<{securitypro}prestashop>securitypro_c38b1f3ca5e83ecb7295bde095bff884'] = 'Politikat e lejuara \'cross-domain\'';
$_MODULE['<{securitypro}prestashop>securitypro_83d9d05ba3eb9b55a44b09712512a4f8'] = 'Parandalon Adobe Flash dhe Adobe Acrobat nga ngarkimi i përmbajtjes në faqen tënde. Kjo mbron nga \'cross-domain middleware\'.';
$_MODULE['<{securitypro}prestashop>securitypro_d804b94245bde55be9d4ffca062a5bf8'] = 'Opsionet e shkarkimit';
$_MODULE['<{securitypro}prestashop>securitypro_ba026aafb59bf1a9013db742004bbfc6'] = 'Kjo çaktivizon opsionin për të hapur një skedar direkt në shkarkim. Vetëm Internet Explorer mbështet këtë \'header\'. Shfletuesit e tjerë do ta injorojnë atë.';
$_MODULE['<{securitypro}prestashop>securitypro_cd7f807b01e243c481a55204b7604e0f'] = 'Fshih informacionin e serverit';
$_MODULE['<{securitypro}prestashop>securitypro_ed4e0a0aae1c5f8eebeefb2d24e746bc'] = 'Hiq të gjitha';
$_MODULE['<{securitypro}prestashop>securitypro_a22a4197f91d805432be5e76754a91b9'] = '\'HTTP headers\' dhe fshih informacionin e serverit.';
$_MODULE['<{securitypro}prestashop>securitypro_bf90236f3183952065580441ebf84b13'] = 'Analizo \'HTTP headers\' të sigurisë';
$_MODULE['<{securitypro}prestashop>securitypro_a2a920ea999bdf5a19260a0af7f9dce3'] = '\'Security Pro\' mund të rregullojë të gjitha paralajmërimet dhe gabimet e raportuara nga';
$_MODULE['<{securitypro}prestashop>securitypro_5899fc00e35af1fead1c86e43179338d'] = 'ti mund të marrësh një';
$_MODULE['<{securitypro}prestashop>securitypro_ca1cd3c3055991bf20499ee86739f7e2'] = 'rezultat';
$_MODULE['<{securitypro}prestashop>securitypro_34ee1981f6dccd1866d4b35375201161'] = 'Firewall i aplikacioneve të uebit';
$_MODULE['<{securitypro}prestashop>securitypro_dfeca5f6286b34961be9d3e5398d93c7'] = 'Ky firewall i aplikacioneve në internet ndihmon për të mbrojtur aplikacionet tuaja në internet nga shfrytëzimet e zakonshme të uebit që mund të ndikojnë në disponueshmërinë, të kompromentojnë sigurinë ose të konsumojnë burime të tepruara. Kjo i bën aplikacionet tuaja të sigurta duke mundësuar rregulla të sigurisë që bllokojnë modelet e zakonshme të sulmit, të tilla si injektimi SQL, skenari ndër-faqesh, etj.';
$_MODULE['<{securitypro}prestashop>securitypro_21c12c099da008b328c4d4c274bd8b31'] = 'Pasi të kesh konfiguruar \'firewall\', mos harro të provosh që gjithçka funksionon normalisht në \'back office\'.';
$_MODULE['<{securitypro}prestashop>securitypro_4dfddd1829f7fb340bd9b36bff6e3130'] = 'Rregullat e \'firewall\'';
$_MODULE['<{securitypro}prestashop>securitypro_205fe1da2c651d26b4600e1a117de1c3'] = 'Mbrojtja DDoS';
$_MODULE['<{securitypro}prestashop>securitypro_f5e642f14f63f7779144f54de6871042'] = 'Mbrojtja kundër \'flood/DDoS\'. Ky është një tipar i shkëlqyeshëm për parandalimin e shumicës së sulmeve DDoS dhe kërkesave automatike të shumëfishta.';
$_MODULE['<{securitypro}prestashop>securitypro_3298f13049d19cffaa37ca931dd4d421'] = 'kërkesa';
$_MODULE['<{securitypro}prestashop>securitypro_3d8463e115ce512bf1b507a42901b370'] = 'Kërkesat e lejuara të faqes për përdoruesin.';
$_MODULE['<{securitypro}prestashop>securitypro_cadece7c7ff2de49dc8a0dcab5befa17'] = 'Kërkesat maksimale';
$_MODULE['<{securitypro}prestashop>securitypro_783e8e29e6a8c3e22baa58a19420eb4f'] = 'sekonda';
$_MODULE['<{securitypro}prestashop>securitypro_29c4a08653ea45189d8b300c3ac093a8'] = 'Intervali kohor për të filluar numërimin e kërkesave të faqeve.';
$_MODULE['<{securitypro}prestashop>securitypro_cb4622932aaf6577814f8d625d5a9fe2'] = 'Koha për të ndëshkuar përdoruesin i cili ka tejkaluar në bërjen e kërkesave.';
$_MODULE['<{securitypro}prestashop>securitypro_835b496bcb0d70a20f1c625f0d69eefc'] = 'Sfidat e hosteve të listuara në Honeypot Project';
$_MODULE['<{securitypro}prestashop>securitypro_abd8fa3388eb8add4aae35df0f9eff5c'] = 'Projekti \'honeypot\' ka një bazë të dhënash të madhe të robotëve/spammerëve të këqij. Nëse ky tipar është aktivizuar, moduli do të kërkojë IP-në e klientëve që hyjnë në faqen tënde kundrejt kësaj baze të të dhënave. Nëse ka një përputhje, klienti do të duhet të zgjidhë një reCAPTCHA për të vazhduar përdorimin e faqes në internet. Motorët e kërkimit përjashtohen nga ky kontroll.';
$_MODULE['<{securitypro}prestashop>securitypro_2801f34a1106e770b88c6a847787143f'] = 'Blloko adresat TOR IPv4 dhe IPv6';
$_MODULE['<{securitypro}prestashop>securitypro_1d5b68bf79cbbea56c5357454062bf7c'] = 'Në disa raste, shfletuesit TOR përdoren nga kriminelët për t\'u fshehur gjatë blerjes nga një kartë krediti e vjedhur. Nëse ke këtë problem, mund të bllokosh adresat TOR IPv4 dhe IPv6 me këtë tipar.';
$_MODULE['<{securitypro}prestashop>securitypro_b459d7e1103a33f6790ca26c05b99715'] = 'Lexo më shumë.';
$_MODULE['<{securitypro}prestashop>securitypro_0a2ea377cdd0c9adc2108d1183d7e523'] = 'Rekomandohet të lësh të çaktivizuar këtë tipar në shumicën e rasteve.';
$_MODULE['<{securitypro}prestashop>securitypro_e2d776def4d5313ad1be6a9ca3dbdcfb'] = 'Injektimi anti SQL';
$_MODULE['<{securitypro}prestashop>securitypro_1fa4e983f2ffa22235d16f9c91fc5c5a'] = 'Injektimi SQL është një dobësi e sigurisë në ueb që lejon një sulmues të ndërhyjë në pyetjet që një aplikacion bën në bazën e të dhënave.';
$_MODULE['<{securitypro}prestashop>securitypro_058889e9902c4c459be242a707783b9e'] = 'Nëse kërkesa duket si një sulm, zgjidh nëse klienti mund të vazhdojë pasi të zgjidhë një sfidë (reCAPTCHA v2), të bllokohet (403) ose të ridrejtohet te \'faqja nuk u gjet\' (404).';
$_MODULE['<{securitypro}prestashop>securitypro_8a95609e9f11b99c0f530e53b0b9bedd'] = 'Kërkesë bllokimi (403)';
$_MODULE['<{securitypro}prestashop>securitypro_30de79f57171903e198a4ad276f2002e'] = 'Faqja nuk u gjet (404)';
$_MODULE['<{securitypro}prestashop>securitypro_8f403184b2ccabfb98fc7cb43f627ab8'] = 'Sfida (reCAPTCHA v2)';
$_MODULE['<{securitypro}prestashop>securitypro_d08ba508ac553502f2181490a47085a4'] = 'Injektimi anti \'XSS\'';
$_MODULE['<{securitypro}prestashop>securitypro_77f1dbf12f16bb7f5469557e26b405cc'] = 'Injektimi \'XSS\' (Cross-Site Scripting) është një dobësi e sigurisë në internet që lejon një sulmues të injektojë kodin (në thelb skriptimin nga klienti) në serverin e largët.';
$_MODULE['<{securitypro}prestashop>securitypro_b0beb9726d1f0096d664844a9da0cbd0'] = 'Injektimi anti komandë';
$_MODULE['<{securitypro}prestashop>securitypro_7a7e950532217f991b3b0303df6e5c87'] = 'Injektimi i komandës është një dobësi e sigurisë në internet që lejon një sulmues të injektojë kod në serverin e largët.';
$_MODULE['<{securitypro}prestashop>securitypro_4a54f30393a409b34275fcf97863bb7d'] = 'Mbrojtja \'RFI\'';
$_MODULE['<{securitypro}prestashop>securitypro_36a2e4c885d8884bf08fb07fe02f6c79'] = 'Përfshirja e skedarit në distancë (RFI) është një sulm që synon dobësitë në aplikacionet në internet që referojnë dinamikisht skriptet e jashtme. Blloko kërkesën nëse kërkesa duket si një sulm \'RFI\'.';
$_MODULE['<{securitypro}prestashop>securitypro_2ef25b4c97863b6a602438b6eec96f9e'] = 'Ky tipar është për përdoruesit e përparuar. Shiko protokollin e \'firewall\'-it nëse e aktivizon këtë tipar, në rast se ke instaluar një modul të palës së tretë që bllokohet nga ky tipar për shkak të hartimit të kërkesës.';
$_MODULE['<{securitypro}prestashop>securitypro_58c00c562614120ea8e87084eac68a89'] = 'Mbrojtja \'XST\'';
$_MODULE['<{securitypro}prestashop>securitypro_fa29bd73073b7046c71bd4006c62013f'] = '\'Cross-Site Tracing (XST)\' është një cenueshmëri e sigurisë në rrjet duke shfrytëzuar metodën \'HTTP TRACE\'. Aktivizo këtë mundësi për të bllokuar kërkesat \'HTTP TRACK\' dhe \'HTTP TRACE\'.';
$_MODULE['<{securitypro}prestashop>securitypro_9ccaf5d0ca684385552b64a4602e747c'] = 'Blloko përshkimin e direktorive';
$_MODULE['<{securitypro}prestashop>securitypro_5a35f4ff3a2b64cf11735d2983518ab2'] = 'Sulmet e përshkimit të direktorive përdorin softuerin e serverit për të shfrytëzuar mekanizmat joadekuat të sigurisë dhe për të hyrë në direktoritë dhe skedarët e ruajtur jashtë dosjes webroot. Ky opsion mbron nga sulmet përshkuese.';
$_MODULE['<{securitypro}prestashop>securitypro_aa4f95d8aa4bff06ea61b965078e626f'] = 'Blloko ngarkimin e skedarit';
$_MODULE['<{securitypro}prestashop>securitypro_73ba0ade7c04be9a196d163de9eb9534'] = 'Bllokon aftësinë për të ngarkuar skedarë në \'back office\' Mos e aktivizo këtë nëse po përdorni formularin e kontaktit ose një modul tjetër të \'front office\' me një funksion transferimi skedari.';
$_MODULE['<{securitypro}prestashop>securitypro_ca6c49feecbd584cc964b0006b07458d'] = 'Skano skedarin në ngarkim';
$_MODULE['<{securitypro}prestashop>securitypro_51c23cdc08094ba397802d895511a988'] = 'Skanon skedarët e ngarkuar në \'front office\' për trojan, viruse, malware dhe kërcënime të tjera dhe bllokon kërkesën nëse skedari është i dyshimtë.';
$_MODULE['<{securitypro}prestashop>securitypro_8501a7c2287d153b7e5bbcfaef0fcb88'] = 'Adresat e listave të bardha IP që nuk duhet të bllokohen nga firewall.';
$_MODULE['<{securitypro}prestashop>securitypro_2977988f0d0d5b4f141a9dbdc67379ed'] = 'Rregullat e personalizuara';
$_MODULE['<{securitypro}prestashop>securitypro_e761e898724434dda3a5fab42acb8918'] = 'Bllokon listën e personalizuar të adresave IP';
$_MODULE['<{securitypro}prestashop>securitypro_03af372a8c94a13d5aa7eece0985aa98'] = 'Bllokon hostet me adresat IP më poshtë nga faqja jote e internetit. Ti nuk mund të bllokosh hostet që janë tashmë në këtë';
$_MODULE['<{securitypro}prestashop>securitypro_d9a726e6080480da3347b7ec40738d38'] = 'listë të bardhë';
$_MODULE['<{securitypro}prestashop>securitypro_ebfc7414e01bc18fb73c15357a1d7c09'] = 'Nëse dëshiron ta bllokosh një vend, të lutem përdor këtë tipar të integruar PrestaShop';
$_MODULE['<{securitypro}prestashop>securitypro_e4c7bb49c00350b1394e549fa93e06d1'] = 'Bklloko vendet';
$_MODULE['<{securitypro}prestashop>securitypro_207cd16f998b9367f6239e3c12940c36'] = 'Në përgjithësi nuk rekomandohet të bllokohen vendet. Vendet e bllokuara mund të zhbllokohen nga klientët të cilët përdorin një VPN ose që janë në pushime në ndonjë vend tjetër, etj.';
$_MODULE['<{securitypro}prestashop>securitypro_1edc672f52aae3357bfbe71b04326ec2'] = 'Nëse klienti është në listën e zezë, zgjidhni nëse klienti mund të vazhdojë pasi të zgjidhë një sfidë (reCAPTCHA v2) ose të bllokohet (403).';
$_MODULE['<{securitypro}prestashop>securitypro_68b9cd384b36f81f8c6f63e7dcd830a2'] = 'Lista e personalizuar e adresave IP';
$_MODULE['<{securitypro}prestashop>securitypro_8bf55c30dc9e15eb1d8204228ae059e1'] = 'Blloko listën e personalizuar të agjentëve të përdoruesit';
$_MODULE['<{securitypro}prestashop>securitypro_50013bbec0f63a7855eb017da2ef18c5'] = 'Bllokon agjentët e përdoruesve me emrat më poshtë nga faqja e jote e internetit.';
$_MODULE['<{securitypro}prestashop>securitypro_526dd3425e21fd60a70e4973ba76dcae'] = 'Lista e personalizuar e agjentëve të përdoruesit';
$_MODULE['<{securitypro}prestashop>securitypro_74be53f281876459fb3c788492c54b60'] = 'Protokollo përpjekjet e piraterisë';
$_MODULE['<{securitypro}prestashop>securitypro_55a0482ffe4f9e35fbeeb1e00177fbe0'] = 'Regjistron përpjekjet e piraterisë në një skedar protokolli.';
$_MODULE['<{securitypro}prestashop>securitypro_6c1bc7112e9bbd9c6c45197e27d5ef1e'] = 'Kjo rekomandohet.';
$_MODULE['<{securitypro}prestashop>securitypro_668551d0cf616a901eb627d55cd4debd'] = 'Nuk është e mundur të zgjatja e kontrollit të formës së kontaktit në PrestaShop 1.6 pa përdorur mbishkrime. Meqenëse ky modul nuk lejohet të përdorë zëvendësime, disa opsione nuk janë të disponueshme. Këto opsione janë në dispozicion për PrestaShop 1.7 pasi PrestaShop 1.7 lejon që moduli të fiksojë këto kontrolle pa përdorur anashkalime.';
$_MODULE['<{securitypro}prestashop>securitypro_6bac4679470b7b7280a8402a48e4713a'] = 'Nuk është e mundur të mbrohet formulari i regjistrimit kur instalohet moduli OPC, pasi moduli OPC mbizotëron formularin vendas të regjistrimit.';
$_MODULE['<{securitypro}prestashop>securitypro_7904ddc38fe0a312f0d50d7e3fb57ea5'] = 'Anti-SPAM';
$_MODULE['<{securitypro}prestashop>securitypro_b1585915f53c64a5560e67becf302476'] = 'SPAM (Shit Posing As Mail) është një problem për shumicën e bizneseve. Ka akoma njerëz që bëhen viktima të sulmeve kibernetike, si p.sh.';
$_MODULE['<{securitypro}prestashop>securitypro_a6c299e69fc6b10ed0e901a9895172bb'] = '\'spamming\'';
$_MODULE['<{securitypro}prestashop>securitypro_be5d5d37542d75f93a87094459f76678'] = 'dhe';
$_MODULE['<{securitypro}prestashop>securitypro_936b58ef16bb5c6235f8ef7be420ad21'] = '\'phishing\'';
$_MODULE['<{securitypro}prestashop>securitypro_c661cf76442d8d2cb318d560285a2a57'] = 'Forma e kontaktit';
$_MODULE['<{securitypro}prestashop>securitypro_f5f64d5e9622d9f4eb226d7b960449ce'] = 'Çaktivizo formën e kontaktit';
$_MODULE['<{securitypro}prestashop>securitypro_3e0bf7285d9f7739277a3049d79eaf5d'] = 'Nëse dëshiron ta çaktivizosh formularin e kontaktit, mund ta aktivizosh këtë tipar..';
$_MODULE['<{securitypro}prestashop>securitypro_2faec1f9f8cc7f8f40d521c4dd574f49'] = 'Aktivizo';
$_MODULE['<{securitypro}prestashop>securitypro_0466fe10780af618041f637bd51e6fe0'] = 'reCAPTCHA v3 kthen një rezultat rreziku për secilën kërkesë pa fërkime të përdoruesit. Moduli përdor këtë rezultat rreziku për të vendosur nëse përdoruesi është një \'bot\' apo një njeri. \'Bot\'-ët nuk do të lejojnë dërgimin e emailave.';
$_MODULE['<{securitypro}prestashop>securitypro_e98932530623240b950fd2b5c631bc47'] = 'Blloko mesazhet e cenueshëm';
