$_MODULE['<{securitypro}prestashop>securitypro_ea381090c5516e5ff029038acb290357'] = 'Ekzistojnë dy arsye thelbësore për të pasur rekord të SPF (Sender Policy Framework) për domen. Siguria - një sulmues mund të dërgojë e-mail të falsifikuar nga domeni i prekshëm nëse rekordi SPF nuk ekziston. Pjesa më e madhe e skanuesit të sigurisë do ta konsiderojnë këtë si \'Missing SPF Record Vulnerability\'. Dërgimi i emailit - në mungesë të rekordit SPF mund të shkaktojë përfundimin e një emaili në kutinë SPAM.';
