$_MODULE['<{securitypro}prestashop>securitypro_3ae74856c2869de1fd28308ade9d1e87'] = 'Ekzistojnë dy arsye thelbësore për të pasur rekord të SPF (Sender Policy Framework) për domen. Siguria - një sulmues mund të dërgojë e-mail të falsifikuar nga domeni i prekshëm nëse rekordi SPF nuk ekziston. Pjesa më e madhe e skanuesit të sigurisë do ta konsiderojnë këtë si \'\'Missing SPF Record Vulnerability\'. Dorëzimi me email - mungesa e rekordit SPF mund të shkaktojë përfundimin e një emaili në kutinë SPAM.';
