$_MODULE['<{securitypro}prestashop>securitypro_cc9145771f0c9722ac6ad862e6f265b0'] = 'Mbështetja për çelësin \'Ephemeral\'';
$_MODULE['<{securitypro}prestashop>securitypro_4fc1887b6de6dd65e79490b55ee3e923'] = '\'Ephemeral keys\' përdoren në disa prej \'cipher suites\' që mbështetë klienti yt. Kjo do të thotë që klienti yt mund të përdoret për të siguruar';
$_MODULE['<{securitypro}prestashop>securitypro_0f1d08aafd44f00a53e9a0d558002205'] = 'forward secrecy';
$_MODULE['<{securitypro}prestashop>securitypro_533d89c3981e8be44fc96147004c0f9e'] = 'Nëse serveri e mbështet atë. Kjo rrit shumë mbrojtjen tënde ndaj përgjuesve, duke përfshirë kundërshtarët global pasivë që mbledhin sasi të mëdha të trafikut të eknriptuar dhe i ruajnë ato derisa sulmet e tyre (ose kompjuterët e tyre) të përmirësohen.';
$_MODULE['<{securitypro}prestashop>securitypro_e05ad17aca0166457b2d8f3ca7756751'] = '\'Ephemeral keys\' nuk përdoren në disa prej \'cipher suites\' që mbështetë klienti yt. Kjo do të thotë që klienti yt mund të përdoret për të siguruar';
$_MODULE['<{securitypro}prestashop>securitypro_232e5f4a7714621ab40010d8aa2897b8'] = 'Pa të, kundërshtarët global pasivë do të jenë në gjendje të mbledhin të gjithë trafikun tënd të enkriptuar dhe ta dekodojnë atë kur sulmet e tyre ose kompjuterët e tyre janë më të shpejtë. Kjo në të vërtetë po ndodh.';
$_MODULE['<{securitypro}prestashop>securitypro_af43c71170f09fc62a4f242801b0e0a1'] = 'Mbështetja e biletave të sesionit';
$_MODULE['<{securitypro}prestashop>securitypro_864431c66b5c8a848c1824ac92911873'] = 'Biletat e seancës mbështeten në klientin tënd. Shërbimet që përdor do të jenë në gjendje të vlerësojnë më lehtë lidhjet e tyre TLS me këtë tipar.';
$_MODULE['<{securitypro}prestashop>securitypro_d41a3b0332bbcf1d4749dc2ca6c1015a'] = 'Biletat e sesionit nuk mbështeten në klientin tënd. Pa to, shërbimet do ta kenë më të vështirë për t\'i bërë të shpejta lidhjet e klientit tuaj. Në përgjithësi, klientët me \'ephemeral key support\' e marrin këtë falas.';
$_MODULE['<{securitypro}prestashop>securitypro_26ef7db6f78505dc9d0a418605e654ed'] = 'Komprimimi TLS';
$_MODULE['<{securitypro}prestashop>securitypro_107ac1a0897e3bec2ccc07458e862e35'] = 'Klienti yt TLS mbështet komprimimin e cilësimeve që enkriptojnë lidhjen tënde. Kjo me të vërtetë nuk është e mirë. Kjo i bën lidhjet tua TLS të ndjeshme ndaj';
$_MODULE['<{securitypro}prestashop>securitypro_2e9ddb3a4c8d1a60777825ea49414899'] = 'sulmeve \'CRIME\'';
$_MODULE['<{securitypro}prestashop>securitypro_203d219ee6d442d3d46aad0e5a5295cb'] = 'dhe të dhënat tua të enkriptuara mund të rrjedhin!';
$_MODULE['<{securitypro}prestashop>securitypro_0cea593c307abe36d21fc3d66adc2646'] = 'Klienti yt TLS nuk përpiqet të komprimojë cilësimet që enkriptojnë lidhjen tënde, duke shmangur rrjedhjet e informacionit nga';
$_MODULE['<{securitypro}prestashop>securitypro_b5fbf8a006495f3d33c95fc6ba974205'] = 'cenushmëria \'BEAST\'';
$_MODULE['<{securitypro}prestashop>securitypro_a65eb596b7a0e3e915c062ac1b2f60f4'] = 'Klienti yt është i hapur ndaj';
$_MODULE['<{securitypro}prestashop>securitypro_76b6124b86ce16e21681ce0802211a43'] = 'sulmit \'BEAST\'';
$_MODULE['<{securitypro}prestashop>securitypro_6bc21b37a88fed8beab6fd2d1f9f1bf2'] = 'Përdor TLS 1.0 ose më të hershëm, ndërsa mbështet gjithashtu një \'cipher suite\' që përdor';
$_MODULE['<{securitypro}prestashop>securitypro_4b55bc5d650c958f21c631c467ee67bc'] = 'Cipher-Block Chaining';
$_MODULE['<{securitypro}prestashop>securitypro_33580f789280a3ae59fa88de89ae05f2'] = 'dhe nuk zbaton \'1/n-1 record splitting mitigation\'. Ky kombinim do të rrjedhë informacion.';
$_MODULE['<{securitypro}prestashop>securitypro_b1f628b17ea76a3f5797c548e6cb99e8'] = 'Klienti yt me gjasë është i hapur për';
$_MODULE['<{securitypro}prestashop>securitypro_4d1867ffcf7d3520a956264f5bcb5630'] = 'sepse përdor TLS 1.0 ose të mëhershëm, ndërsa gjithashtu mbështet një \'cipher suite\' që përdor';
$_MODULE['<{securitypro}prestashop>securitypro_0402ab8a803c813f73f859c9f864ae9e'] = 'Sidoqoftë, \'CBC cipher suites\' që mbështet nuk klienti yt është një nga \'How\'s My SSL\' që është në gjendje të përdorë, kështu që nuk ishte në gjendje të përcaktojë nëse klienti yt zbaton \'1/n-1 record splitting mitigation\'. Klientët me atë zgjedhje të pazakonshme të \'cipher suite\' rrallë e zbatojnë atë, megjithatë, është më mirë të supozojmë më të keqen.';
$_MODULE['<{securitypro}prestashop>securitypro_f48d3b87b17e0c91bbba9d323ae53666'] = 'Klienti yt nuk është i prekshëm nga';
$_MODULE['<{securitypro}prestashop>securitypro_25e4001cb951190d523f25f3c4a47d17'] = 'Ndërsa përdor TLS 1.0 së bashku me';
$_MODULE['<{securitypro}prestashop>securitypro_49cdb07efc8f25ba680a428d290aa804'] = '\'cipher suites\', ka zbatuar \'1/n-1 record splitting mitigation\'.';
$_MODULE['<{securitypro}prestashop>securitypro_b0a16fd8e7002653a7af7e89c7225ba3'] = 'sepse përdor një protokoll TLS më të ri se TLS 1.0. Sulmi \'BEAST\' është i mundur vetëm kundër klientëve që përdorin TLS 1.0 ose të mëhershëm që përdorin';
$_MODULE['<{securitypro}prestashop>securitypro_59a5c07e5472e8a744589ebdbf07feea'] = '\'cipher suites\' që nuk zbatojnë \'1/n-1 record splitting mitigation\'.';
$_MODULE['<{securitypro}prestashop>securitypro_1f88d0d8821c2a21933b99f3fc818447'] = '\'Cipher Suites\' të pasigurta';
$_MODULE['<{securitypro}prestashop>securitypro_99777eeea5a301cda958d0ce88cdc728'] = 'Klienti yt mbështet \'cipher suites\' që dihet se janë të pasigurta';
$_MODULE['<{securitypro}prestashop>securitypro_e314cde2cb6a77e02af95a0f39c35623'] = 'Klienti yt mbështet nuk përdor ndonjë \'cipher suites\' që dihet se është i pasigurt.';
$_MODULE['<{securitypro}prestashop>securitypro_401fe8f875d55bc2daf39c3528b8e418'] = 'Cenueshmëria \'Heartbleed\'';
$_MODULE['<{securitypro}prestashop>securitypro_2f20ce88a50062028947633daa8e6630'] = '\'Heartbleed Bug\' është një dobësi serioze në bibliotekën e njohur të softuerit kriptografik \'OpenSSL\'. Kjo dobësi lejon vjedhjen e informacionit të mbrojtur, në kushte normale, nga enkriptimi SSL / TLS i përdorur për të siguruar internetin.';
$_MODULE['<{securitypro}prestashop>securitypro_21bfa877bd559b13eda216546d1cb4ef'] = 'Cenueshmëria e injektimit \'CCS\'';
$_MODULE['<{securitypro}prestashop>securitypro_b2ecd17db9bd96b409f3f8d8dcf8c907'] = 'Përpunimi i \'OpenSSL\'s ChangeCipherSpec\' ka një cenueshmëri serioze. Kjo dobësi lejon nyjet e ndërmjetme me qëllim të keq të kapin të dhëna të koduara dhe t\'i deshifrojnë ato ndërsa i detyron klientët SSL të përdorin çelësa të dobët të ekspozuar ndaj nyjeve me qëllim të keq.';
$_MODULE['<{securitypro}prestashop>securitypro_9738426fe28a50aa318c0a437f2168ce'] = 'Cenueshmëria \'DROWN\'';
$_MODULE['<{securitypro}prestashop>securitypro_a1a3f2b6fa03e3be939a58ea3a160de9'] = '\'DROWN\' është një dobësi serioze që prek HTTPS dhe shërbime të tjera që mbështeten në SSL dhe TLS, disa nga protokollet thelbësore kriptografike për sigurinë e Internetit. Këto protokolle i lejojnë të gjithë në Internet të shfletojnë në internet, të përdorin postë elektronike, të blejnë në internet dhe të dërgojnë mesazhe të çastit pa mundur që palët e treta të lexojnë komunikimin.';
$_MODULE['<{securitypro}prestashop>securitypro_5a6f16d26dc54481d8e481026a5451af'] = 'Cenueshmëria \'POODLE\'';
$_MODULE['<{securitypro}prestashop>securitypro_3e60817d95f93545d490ec2dd2b7c997'] = 'Sulmi \'POODLE\' (Padding Oracle on Downgraded Legacy Encryption) shfrytëzon një cenueshmëri në protokollin SSL 3.0. Kjo dobësi lejon që një sulmues të përgjojë komunikimin e enkriptuar duke përdorur SSLv3. Dobësia nuk është më e pranishme në protokollin e \'Transport Layer Security protocol\' (TLS), pasardhësi i SSL.';
$_MODULE['<{securitypro}prestashop>securitypro_4c3de93f8c795b8d9dafaed3b9e19279'] = '\'Cipher suites\' e dhëna';
$_MODULE['<{securitypro}prestashop>securitypro_1dc8b2558fa4f5578f169df70fb6d24b'] = '\'Cipher suites\' të klientit tënd thanë se mbështesin, në vend që t\'i dërgojnë atyre, janë';
$_MODULE['<{securitypro}prestashop>securitypro_42009c234b970a840644aaafe91df23c'] = 'Përmbajtja e përzier';
$_MODULE['<{securitypro}prestashop>securitypro_c23701f967f5de7034113864d7cdf10f'] = 'Përmbajtja e përzier ndodh kur HTML fillestare ngarkohet përmes një lidhjeje të sigurt HTTPS. Sidoqoftë, burimet e tjera (të tilla si imazhet, videot, stylesheets, skriptet) ngarkohen përmes një lidhjeje të pasigurt HTTP. Kjo quhet përmbajtje e përzier sepse të dy përmbajtjet HTTP dhe HTTPS po ngarkohen për të shfaqur të njëjtën faqe dhe kërkesa fillestare ishte e sigurt mbi HTTPS. Shfletuesit modernë shfaqin paralajmërime rreth këtij lloji të përmbajtjes për të treguar që kjo faqe përmban burime të pasigurta.';
$_MODULE['<{securitypro}prestashop>securitypro_19c1eba621f7835d8a8bcf6d2b45ba62'] = 'Skano për përmbajtje të përzier';
$_MODULE['<{securitypro}prestashop>securitypro_567075330b1d8495d4345068068f650d'] = 'Analizimi i SSL/TLS';
$_MODULE['<{securitypro}prestashop>securitypro_493f3e9958a6c7769db256d3a8c1a6ba'] = 'Skano faqen tënde të internetit me \'SSL Labs\'. Kjo mund të japë një kuptim më të mirë se si vendoset \'SSL/TLS\'.';
$_MODULE['<{securitypro}prestashop>securitypro_5cb902b9480bb17a70c905c0a3c0a154'] = 'HSTS header';
$_MODULE['<{securitypro}prestashop>securitypro_774050bb1f5b2787e66b5e43936256ef'] = 'HSTS (\'HTTP Strict Transport Security\') mbron nga sulmi i degradimit të protokollit dhe rrëmbimi i biskotave. HSTS është një mënyrë që faqet të zgjedhin gjithmonë për të përdorur HTTPS. Këtë tipar mund ta aktivizosh në';
$_MODULE['<{securitypro}prestashop>securitypro_2759ccacae1e56051dcab65c677284ba'] = 'HSTS Security headers';
$_MODULE['<{securitypro}prestashop>securitypro_200a71ae0c2b1a4ccc3f1e43b0be1503'] = 'HSTS listed';
$_MODULE['<{securitypro}prestashop>securitypro_d1e806e6caee718c3e746196c998b807'] = 'Kontrollon nëse faqja jote është listuar në listën e para-ngarkimit. Është praktika më e mirë të jetë në listën e parangarkesës. Ti duhet ta paraqesësh faqen tënde në \'hstspreload.org\' për të siguruar që ajo të jetë e ngarkuar me sukses, për të marrë mbrojtjen e plotë të konfigurimit të synuar.';
$_MODULE['<{securitypro}prestashop>securitypro_b2d97eb9ae8ac5e44f68527631e61483'] = 'Po ridrejtohet te HTTPS';
$_MODULE['<{securitypro}prestashop>securitypro_33d20c8292793452435e33517cc58b22'] = 'Kontrollon nëse ueb serveri yt ridrejton automatikisht vizitorët nga HTTP në HTTPS. HTTPS u jep përdoruesve tu një lidhje të sigurt me faqen tënde të internetit. Është e njohur nga dryri në shfletuesin tënd të uebit.';
$_MODULE['<{securitypro}prestashop>securitypro_f989e124fa3a2321cb7173bcd8fc317f'] = 'Biskotat e sigurta';
$_MODULE['<{securitypro}prestashop>securitypro_61392abf91987608bb568c9f4e77d0e8'] = '\'Cookie secure\' specifikon nëse biskotat duhet të dërgohen vetëm përmes lidhjeve të sigurta. Ky cilësim kërkon që SSL/TLS të aktivizohet.';
$_MODULE['<{securitypro}prestashop>securitypro_413dd0441d1393425724078c6132512c'] = 'Kontrolli i zbatimit';
$_MODULE['<{securitypro}prestashop>securitypro_807402b2447c57bd90060f83ba51c561'] = 'Informatat themelore';
$_MODULE['<{securitypro}prestashop>securitypro_739e6d2a73723ec7b1919fa5a51f9b07'] = 'Analiza';
$_MODULE['<{securitypro}prestashop>securitypro_efb3a9c9d1c10566690d7ec11a879858'] = 'Duhet të instalosh një certifikatë TLS dhe';
$_MODULE['<{securitypro}prestashop>securitypro_3eea5576b31062a4bf5ea462fb06e5b5'] = 'aktivizo SSL kudo';
$_MODULE['<{securitypro}prestashop>securitypro_c0b3299e1836cc736147e297d2312030'] = 'para se të kryhet analiza.';
$_MODULE['<{securitypro}prestashop>securitypro_be667d0da20c5b7c4a78d90aecc3920a'] = 'Të gjitha faqet duhet të mbrohen me HTTPS, madje edhe ato që nuk trajtojnë të dhëna të ndjeshme. Kjo përfshin shmangien e përmbajtjes së përzier, ku disa burime ngarkohen mbi HTTP, pavarësisht se kërkesa fillestare shërbehet mbi HTTPS. HTTPS parandalon ndërhyrësit të ndërhyjnë ose të dëgjojnë pasivisht komunikimet midis aplikacionit tuaj dhe përdoruesve tuaj dhe është një parakusht për HTTP/2 dhe shumë API të platformave të reja.';
$_MODULE['<{securitypro}prestashop>securitypro_604cf9c8425b3d20dbcae2f1c4bc575a'] = 'Emri teknik i modulit';
$_MODULE['<{securitypro}prestashop>securitypro_f045c4d830a7004c50777c5d46f2a71a'] = 'Emri i shfaqur i modulit';
$_MODULE['<{securitypro}prestashop>securitypro_c0405d71f21e769c787a10b9620f11ea'] = 'I besueshëm';
$_MODULE['<{securitypro}prestashop>securitypro_886e2fe9ad36b443bc2c7f487549692d'] = 'Analizimi i moduleve';
$_MODULE['<{securitypro}prestashop>securitypro_890db17c7b1e9027fa16459c342ac756'] = 'Modulet të cilat nuk janë natyrale të PrestaShop ose nuk janë blerë nga PrestaShop \'Addons\', nuk janë të besueshëm. Kjo do të thotë që PrestaShop nuk i verifikon ato. Këto module mund të jenë të sigurta edhe pse PrestaShop nuk i verifikon ato, por ke kujdes - në disa raste, këto module nuk ndjekin udhëzimet e PrestaShop dhe mund të jenë të pasigurta. Në përgjithësi, modulet e palëve të treta ofrojnë rreziqe shtesë të sigurisë. Ndonjëherë faqet e internetit hakohen edhe pse module të pasigurta të palëve të treta. Nëse ka ndonjë modul që nuk ju nevojitet, rekomandohet t\'i çinstalosh ato.';
$_MODULE['<{securitypro}prestashop>securitypro_0f62eab3691a6a8f71fe67364aabe8f5'] = 'Hapi 1: Konfigurimi i \'Security Pro\'';
$_MODULE['<{securitypro}prestashop>securitypro_ccb4cacae7a490a8aa4e402442dbc1f1'] = 'Rekomandohet të bësh një konfigurim manual të modulit. Sidoqoftë, nëse shumë tipare duken mbizotëruese, mund të ekzekutosh një konfigurim automatik themelor të modulit. Pastaj më pas mund të rregullosh detajet në varësi të nevojave tua.';
$_MODULE['<{securitypro}prestashop>securitypro_897746d4eb33ad89163e1ae494576ea5'] = 'Para se të vazhdojmë, rekomandohet të shtosh çelësat e mëposhtëm në';
$_MODULE['<{securitypro}prestashop>securitypro_8af28e7c3c6b244d01e4871c14846a91'] = 'Site key (reCAPTCHA v2)';
$_MODULE['<{securitypro}prestashop>securitypro_792c10057c5e12b55dc8938c1c284812'] = 'Secret key (reCAPTCHA v2)';
$_MODULE['<{securitypro}prestashop>securitypro_7517eb561846638857940c1f5d5c73fb'] = 'Nis auto-konfigurimin';
$_MODULE['<{securitypro}prestashop>securitypro_d6685d66747a8b4ac570aff40bb65e9d'] = 'Je i sigurt që dëshiron të ekzekutosh konfigurimin automatik? Cilësimet tua aktuale të modulit do të anashkalohen.';
$_MODULE['<{securitypro}prestashop>securitypro_5b7cb899464bf22ecca896a36493c2f6'] = 'Hapi 2: Rregullo dobësitë e sigurisë në sistemin tënd';
$_MODULE['<{securitypro}prestashop>securitypro_e43ec38a93023bde02ff70f28b925702'] = 'Shko te';
$_MODULE['<{securitypro}prestashop>securitypro_95fd0221db4309000ab8ca0fbdce596c'] = 'Aty do të gjesh mjete për të rregulluar lejet e pasigurta të skedarëve, cenueshmërinë e përshkimit të direktorive dhe një mjet për të fshirë skedarët që e bëjnë dyqanin tënd të cenueshëm. Është e mundur të gjenerohet një raport, për ta kuptuar se çfarë ndryshimesh do të bëjnë mjetet.';
$_MODULE['<{securitypro}prestashop>securitypro_f61be8a6f357e451054b1be9170842b0'] = 'Hapi 3: Analizo sistemin tënd';
$_MODULE['<{securitypro}prestashop>securitypro_7256e71afef30f6726fdb2b9df8913d6'] = 'dhe rregullo sa më shumë dobësi të jetë e mundur.';
$_MODULE['<{securitypro}prestashop>securitypro_eeb398275c8b64facadaa5a00baa0b85'] = 'Hapi 4: Analizo konfigurimin e serverit tënd';
$_MODULE['<{securitypro}prestashop>securitypro_3fd4e12314b1449a33ed62e87a16f09e'] = 'dhe hidhi një vështrim analizës. Këtu do të shohësh disa këshilla të përparuara për të përmirësuar skedarin tënd të konfigurimit \'PHP configuration\'. Nëse nuk ke njohuri me këtë lloj konfigurimi, mund të kërkosh ndihmë nga hosti yt.';
$_MODULE['<{securitypro}prestashop>securitypro_2fe0271afe20cec58bfbed84de2870f8'] = 'Hapi 5: Analizo modulet tua';
$_MODULE['<{securitypro}prestashop>securitypro_698c389b6b3846331cf46d6c80afd7c1'] = 'Këtu do të shohësh të gjitha modulet e instaluara në dyqanin tënd. Nëse nuk je duke përdorur disa nga modulet, rekomandohet që t\'i çinstalosh ato, veçanërisht nëse atyre moduleve nuk iu besohen.';
$_MODULE['<{securitypro}prestashop>securitypro_aff133b9ad6d3110dbcdfc1c46955ef7'] = 'Hapi 6: Testo dyqanin tënd';
$_MODULE['<{securitypro}prestashop>securitypro_79528a41f8898a17433f77ae63433097'] = 'Tani testo faqen tënde të internetit për të konfirmuar që gjithçka po funksionon:';
$_MODULE['<{securitypro}prestashop>securitypro_832b70d5de272ac713043f2314ab4130'] = 'Regjistro një klient të ri';
$_MODULE['<{securitypro}prestashop>securitypro_c79e11eb0fa98851b7aa3ddf9b0c8c08'] = 'Bëje një urdhërblerje provë';
$_MODULE['<{securitypro}prestashop>securitypro_a38eacb95d5f3c0a5c13bc51235c63bd'] = 'Navigo në produkte të ndryshme';
$_MODULE['<{securitypro}prestashop>securitypro_eff2d3b7f1e6189ae3b1f7222a7637b6'] = 'Navigo në kategori të ndryshme';
$_MODULE['<{securitypro}prestashop>securitypro_95d8e729d605b670165c148a2c55babb'] = 'Hapi 7: Instalo punët  kronometrike';
$_MODULE['<{securitypro}prestashop>securitypro_f4af02b6a10875646863a46f95baa95e'] = 'Shko te';
$_MODULE['<{securitypro}prestashop>securitypro_2e521cd48a71ff7ab60adaf265617d20'] = 'Aty do të shohësh një seksion me emrin \'Punë kronometrike\'. Punët kronometrike janë të bazuara në punë të sistemet operative kompjuterike të ngjashme me Unix. Punët kronometrike përdoren për të ekzekutuar tipare si skaneri i \'malware\', shërbimin e monitorimit, krijimin e kopjeve rezervë, etj. Rekomandohet të instalosh këto punë kronometrike për t\'u ekzekutuar një herë në ditë. Nëse nuk je i njohur me punë kronometrike, mund të kërkosh ndihmë nga hosti yt.';
